                               Pokemon(Name: "Suicune", types: "Water", DexEntry: "It races around the world to purify fouled water. It dashes away with the north wind.", pokedexNumber: 245, RoutesFound: "Roaming Johto", Wieght: "412.3 lbs", Hieght: "6' 7\""),
                               Pokemon(Name: "Larvitar", types: "Rock, Ground", DexEntry: "It feeds on soil. After it has eaten a large mountain, it will fall asleep so it can grow.", pokedexNumber: 246, RoutesFound: "Mt. Silver", Wieght: "158.7 lbs", Hieght: "2' 0\""),
                               Pokemon(Name: "Pupitar", types: "Rock, Ground", DexEntry: "Its shell is as hard as sheet rock, and it is also very strong. Its thrashing can topple a mountain.", pokedexNumber: 247, RoutesFound: "Evolve Larvitar", Wieght: "335.1 lbs", Hieght: "3' 11\""),
                               Pokemon(Name: "Tyranitar", types: "Rock, Dark", DexEntry: "In just one of its mighty hands, it has the power to make the ground shake and mountains crumble.", pokedexNumber: 248, RoutesFound: "Evolve Pupitar", Wieght: "562.2 lbs", Hieght: "6' 7\""),
                               Pokemon(Name: "Lugia", types: "Psychic, Flying", DexEntry: "It is said to be the guardian of the seas. It is rumored to have been seen on the night of a storm.", pokedexNumber: 249, RoutesFound: "Whirl Islands", Wieght: "476.2 lbs", Hieght: "17' 1\""),
                               Pokemon(Name: "Ho-oh", types: "Fire, Flying", DexEntry: "A legend says that its body glows in seven colors and that a rainbow is said to form behind it when it flies.", pokedexNumber: 250, RoutesFound: "Tin Tower", Wieght: "438.7 lbs", Hieght: "12' 6\""),
                               Pokemon(Name: "Celebi", types: "Psychic, Grass", DexEntry: "This Pokémon wanders across time. Grass and trees flourish in the forests in which it has appeared.", pokedexNumber: 251, RoutesFound: "Ilex Forest (Event)", Wieght: "11.0 lbs", Hieght: "2' 0\""),
                               Pokemon(Name: "Treecko", types: "Grass", DexEntry: "It makes its nest in a giant tree in the forest. It ferociously guards against anything nearing its territory. It is said to be the protector of the forest’s trees.", pokedexNumber: 252, RoutesFound: "Route 101, Route 102", Wieght: "5.0 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Grovyle", types: "Grass", DexEntry: "The leaves growing on Grovyle’s body are convenient for camouflaging it from enemies in the forest. This Pokémon is a master at climbing trees in jungles.", pokedexNumber: 253, RoutesFound: "Evolve Treecko", Wieght: "21.6 kg", Hieght: "0.9 m"),
                               Pokemon(Name: "Sceptile", types: "Grass", DexEntry: "The leaves growing on Sceptile’s body are very sharp edged. This Pokémon is very agile—it leaps all over the branches of trees and jumps on its foe from above or behind.", pokedexNumber: 254, RoutesFound: "Evolve Grovyle", Wieght: "52.2 kg", Hieght: "1.7 m"),
                               Pokemon(Name: "Torchic", types: "Fire", DexEntry: "Torchic has a place inside its body where it keeps its flame. Give it a hug—it will be glowing with warmth. This Pokémon is covered all over by a fluffy coat of down.", pokedexNumber: 255, RoutesFound: "Route 101", Wieght: "2.5 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Combusken", types: "Fire/Fighting", DexEntry: "Combusken battles with the intensely hot flames it spews from its beak and with outstandingly destructive kicks. This Pokémon’s cry is very loud and distracting.", pokedexNumber: 256, RoutesFound: "Evolve Torchic", Wieght: "19.5 kg", Hieght: "0.9 m"),
                               Pokemon(Name: "Blaziken", types: "Fire/Fighting", DexEntry: "In battle, Blaziken blows out intense flames from its wrists and attacks foes courageously. The stronger the foe, the more intensely this Pokémon’s wrists burn.", pokedexNumber: 257, RoutesFound: "Evolve Combusken", Wieght: "52.0 kg", Hieght: "1.9 m"),
                               Pokemon(Name: "Mudkip", types: "Water", DexEntry: "The fin on Mudkip’s head acts as highly sensitive radar. Using this fin to sense movements of water and air, this Pokémon can determine what is taking place around it without using its eyes.", pokedexNumber: 258, RoutesFound: "Route 101", Wieght: "7.6 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Marshtomp", types: "Water/Ground", DexEntry: "The surface of Marshtomp’s body is enveloped by a thin, sticky film that enables it to live on land. This Pokémon plays in mud on beaches when the ocean tide is low.", pokedexNumber: 259, RoutesFound: "Evolve Mudkip", Wieght: "28.0 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Swampert", types: "Water/Ground", DexEntry: "Swampert is very strong. It has enough power to easily drag a boulder weighing more than a ton. This Pokémon also has powerful vision that lets it see even in murky water.", pokedexNumber: 260, RoutesFound: "Evolve Marshtomp", Wieght: "81.9 kg", Hieght: "1.5 m"),
                               Pokemon(Name: "Poochyena", types: "Dark", DexEntry: "At first sight, Poochyena takes a bite at anything that moves. This Pokémon chases after prey until the victim becomes exhausted. However, it may turn tail if the prey strikes back.", pokedexNumber: 261, RoutesFound: "Route 101, Route 102", Wieght: "13.6 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Mightyena", types: "Dark", DexEntry: "Mightyena gives obvious signals when it is preparing to attack. It starts to growl deeply and then flattens its body. This Pokémon will bite savagely with its sharply pointed fangs.", pokedexNumber: 262, RoutesFound: "Evolve Poochyena", Wieght: "37.0 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Zigzagoon", types: "Normal", DexEntry: "Zigzagoon restlessly wanders everywhere at all times. This Pokémon does so because it is very curious. It becomes interested in anything that it happens to see.", pokedexNumber: 263, RoutesFound: "Route 101", Wieght: "17.5 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Linoone", types: "Normal", DexEntry: "Linoone always runs full speed and only in straight lines. If facing an obstacle, it makes a right-angle turn to evade it. This Pokémon is very challenged by gently curving roads.", pokedexNumber: 264, RoutesFound: "Evolve Zigzagoon", Wieght: "32.5 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Wurmple", types: "Bug", DexEntry: "Wurmple is targeted by Swellow as prey. This Pokémon will try to resist by pointing the spikes on its rear at the attacking predator. It will weaken the foe by leaking poison from the spikes.", pokedexNumber: 265, RoutesFound: "Route 101", Wieght: "3.6 kg", Hieght: "0.3 m"),
                               Pokemon(Name: "Silcoon", types: "Bug", DexEntry: "Silcoon tethers itself to a tree branch using silk to keep from falling. There, this Pokémon hangs quietly while it awaits evolution. It peers out of the silk cocoon through a small hole.", pokedexNumber: 266, RoutesFound: "Evolve Wurmple", Wieght: "10.0 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Beautifly", types: "Bug/Flying", DexEntry: "Beautifly’s favorite food is the sweet pollen of flowers. If you want to see this Pokémon, just leave a potted flower by an open window. Beautifly is sure to come looking for pollen.", pokedexNumber: 267, RoutesFound: "Evolve Silcoon", Wieght: "28.4 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Cascoon", types: "Bug", DexEntry: "Cascoon makes its protective cocoon by wrapping its body entirely with a fine silk from its mouth. Once the silk goes around its body, it hardens. This Pokémon prepares for its evolution inside the cocoon.", pokedexNumber: 268, RoutesFound: "Evolve Wurmple", Wieght: "11.5 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Dustox", types: "Bug/Poison", DexEntry: "Dustox is instinctively drawn to light. Swarms of this Pokémon are attracted by the bright lights of cities, where they wreak havoc by stripping the leaves off roadside trees for food.", pokedexNumber: 269, RoutesFound: "Evolve Cascoon", Wieght: "31.6 kg", Hieght: "1.2 m"),
                               Pokemon(Name: "Lotad", types: "Water/Grass", DexEntry: "Lotad is said to have dwelled on land before. However, this Pokémon is thought to have returned to water because the leaf on its head grew large and heavy. It now lives by floating atop the water.", pokedexNumber: 270, RoutesFound: "Route 102", Wieght: "2.6 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Lombre", types: "Water/Grass", DexEntry: "Lombre’s entire body is covered by a slippery, slimy film. It feels horribly unpleasant to be touched by this Pokémon’s hands. Lombre is often mistaken for a human child.", pokedexNumber: 271, RoutesFound: "Evolve Lotad", Wieght: "32.5 kg", Hieght: "1.2 m"),
                               Pokemon(Name: "Ludicolo", types: "Water/Grass", DexEntry: "Upon hearing an upbeat and cheerful rhythm, the cells in Ludicolo’s body become very energetic and active. Even in battle, this Pokémon will exhibit an amazing amount of power.", pokedexNumber: 272, RoutesFound: "Evolve Lombre", Wieght: "55.0 kg", Hieght: "1.5 m"),
                               Pokemon(Name: "Seedot", types: "Grass", DexEntry: "Seedot attaches itself to a tree branch using the top of its head. It sucks moisture from the tree while hanging off the branch. The more water it drinks, the glossier this Pokémon’s body becomes.", pokedexNumber: 273, RoutesFound: "Route 102", Wieght: "4.0 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Nuzleaf", types: "Grass/Dark", DexEntry: "Nuzleaf live in densely overgrown forests. They occasionally venture out of the forest to startle people. This Pokémon dislikes having its long nose pinched.", pokedexNumber: 274, RoutesFound: "Evolve Seedot", Wieght: "28.0 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Shiftry", types: "Grass/Dark", DexEntry: "Shiftry is a mysterious Pokémon that is said to live atop towering trees dating back over a thousand years. It creates terrific windstorms with the fans it holds.", pokedexNumber: 275, RoutesFound: "Evolve Nuzleaf", Wieght: "59.6 kg", Hieght: "1.3 m"),
                               Pokemon(Name: "Taillow", types: "Normal/Flying", DexEntry: "Taillow courageously stands its ground against foes, however strong they may be. This gutsy Pokémon will remain defiant even after a loss. On the other hand, it cries loudly if it becomes hungry.", pokedexNumber: 276, RoutesFound: "Route 104", Wieght: "2.3 kg", Hieght: "0.3 m"),
                               Pokemon(Name: "Swellow", types: "Normal/Flying", DexEntry: "Swellow flies high above our heads, making graceful arcs in the sky. This Pokémon dives at a steep angle as soon as it spots its prey. The hapless prey is tightly grasped by Swellow’s clawed feet, preventing escape.", pokedexNumber: 277, RoutesFound: "Evolve Taillow", Wieght: "19.8 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Wingull", types: "Water/Flying", DexEntry: "Wingull rides updrafts rising from the sea by extending its long and narrow wings to glide. This Pokémon’s long beak is useful for catching prey.", pokedexNumber: 278, RoutesFound: "Route 103", Wieght: "9.5 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Pelipper", types: "Water/Flying", DexEntry: "Pelipper searches for food while in flight by skimming the wave tops. This Pokémon dips its large bill in the sea to scoop up food, scooping up entire Wailmer and Wingull at once.", pokedexNumber: 279, RoutesFound: "Evolve Wingull", Wieght: "28.0 kg", Hieght: "1.2 m"),
                               Pokemon(Name: "Ralts", types: "Psychic/Fairy", DexEntry: "Ralts senses the emotions of people using the horns on its head. This Pokémon rarely appears before people. But when it does, it draws closer if it senses that the person has a positive disposition.", pokedexNumber: 280, RoutesFound: "Route 102", Wieght: "6.6 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Kirlia", types: "Psychic/Fairy", DexEntry: "Kirlia has the psychic power to create a rip in the dimensions and see into the future. It is said to dance with pleasure on sunny mornings.", pokedexNumber: 281, RoutesFound: "Evolve Ralts", Wieght: "20.2 kg", Hieght: "0.8 m"),
                               Pokemon(Name: "Gardevoir", types: "Psychic/Fairy", DexEntry: "Gardevoir has the ability to read the future. If it senses impending danger to its Trainer, this Pokémon is said to unleash its psychokinetic energy at full power.", pokedexNumber: 282, RoutesFound: "Evolve Kirlia", Wieght: "48.4 kg", Hieght: "1.6 m"),
                               Pokemon(Name: "Surskit", types: "Bug/Water", DexEntry: "From the tips of its feet, Surskit secretes an oil that enables it to walk on water as if it were skating. This Pokémon feeds on microscopic organisms in ponds and lakes.", pokedexNumber: 283, RoutesFound: "Route 102", Wieght: "1.7 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Masquerain", types: "Bug/Flying", DexEntry: "Masquerain intimidates enemies with the eye-like patterns on its antennas. This Pokémon flaps its four wings to freely fly in any direction—even sideways and backwards—as if it were a helicopter.", pokedexNumber: 284, RoutesFound: "Evolve Surskit", Wieght: "3.6 kg", Hieght: "0.8 m"),
                               Pokemon(Name: "Shroomish", types: "Grass", DexEntry: "Shroomish live in damp soil in the dark depths of forests. They are often found keeping still under fallen leaves. This Pokémon feeds on compost that is made up of fallen, rotted leaves.", pokedexNumber: 285, RoutesFound: "Route 104", Wieght: "4.5 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Breloom", types: "Grass/Fighting", DexEntry: "Breloom closes in on its foe with light and sprightly footwork, then throws punches with its stretchy arms. This Pokémon’s fighting technique puts boxers to shame.", pokedexNumber: 286, RoutesFound: "Evolve Shroomish", Wieght: "39.2 kg", Hieght: "1.2 m"),
                               Pokemon(Name: "Slakoth", types: "Normal", DexEntry: "Slakoth’s heart beats just once a minute. Whatever happens, it is content to loaf around motionless. It is rare to see this Pokémon in motion.", pokedexNumber: 287, RoutesFound: "Route 102", Wieght: "24.0 kg", Hieght: "0.8 m"),
                               Pokemon(Name: "Vigoroth", types: "Normal", DexEntry: "Vigoroth is always itching and agitated to go on a wild rampage. It simply can’t tolerate sitting still for even a minute. This Pokémon’s stress level rises if it can’t be moving constantly.", pokedexNumber: 288, RoutesFound: "Evolve Slakoth", Wieght: "46.5 kg", Hieght: "1.4 m"),
                               Pokemon(Name: "Slaking", types: "Normal", DexEntry: "Slaking spends all day lying down and lolling about. It eats grass growing within its reach. If it eats all the grass it can reach, this Pokémon reluctantly moves to another spot.", pokedexNumber: 289, RoutesFound: "Evolve Vigoroth", Wieght: "130.5 kg", Hieght: "2.0 m"),
                               Pokemon(Name: "Nincada", types: "Bug/Ground", DexEntry: "Nincada lives underground for many years in complete darkness. This Pokémon absorbs nutrients from the roots of trees. It stays motionless as it waits for evolution.", pokedexNumber: 290, RoutesFound: "Route 116", Wieght: "5.5 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Ninjask", types: "Bug/Flying", DexEntry: "Ninjask moves around at such a high speed that it cannot be seen, even while its crying can be clearly heard. For that reason, this Pokémon was long believed to be invisible.", pokedexNumber: 291, RoutesFound: "Evolve Nincada", Wieght: "12.0 kg", Hieght: "0.8 m"),
                               Pokemon(Name: "Shedinja", types: "Bug/Ghost", DexEntry: "Shedinja’s hard body doesn’t move—not even a twitch. In fact, its body appears to be merely a hollow shell. It is believed that this Pokémon will steal the spirit of anyone peering into its hollow body from its back.", pokedexNumber: 292, RoutesFound: "Evolve Nincada", Wieght: "1.2 kg", Hieght: "0.8 m"),
                               Pokemon(Name: "Whismur", types: "Normal", DexEntry: "Normally, Whismur’s voice is very quiet—it is barely audible even if one is paying close attention. However, if this Pokémon senses danger, it starts crying at an earsplitting volume.", pokedexNumber: 293, RoutesFound: "Route 116", Wieght: "16.3 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Loudred", types: "Normal", DexEntry: "Loudred shouts while stamping its feet. After it finishes shouting, this Pokémon becomes incapable of hearing anything for a while. This is considered to be a weak point.", pokedexNumber: 294, RoutesFound: "Evolve Whismur", Wieght: "40.5 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Exploud", types: "Normal", DexEntry: "Exploud triggers earthquakes with the tremors it creates by bellowing. If this Pokémon violently inhales from the ports on its body, it’s a sign that it is preparing to let loose a huge bellow.", pokedexNumber: 295, RoutesFound: "Evolve Loudred", Wieght: "84.0 kg", Hieght: "1.5 m"),
                               Pokemon(Name: "Makuhita", types: "Fighting", DexEntry: "Makuhita has a tireless spirit—it will never give up hope. It eats a lot of food, gets plenty of sleep, and it trains very rigorously. By living that way, this Pokémon packs its body with energy.", pokedexNumber: 296, RoutesFound: "Route 115", Wieght: "86.4 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Hariyama", types: "Fighting", DexEntry: "Hariyama practices its straight-arm slaps in any number of locations. One hit of this Pokémon’s powerful, openhanded, straight-arm punches could snap a telephone pole in two.", pokedexNumber: 297, RoutesFound: "Evolve Makuhita", Wieght: "253.8 kg", Hieght: "2.3 m"),
                               Pokemon(Name: "Azurill", types: "Normal/Fairy", DexEntry: "Azurill spins its tail as if it were a lasso, then hurls it far. The momentum of the throw sends its body flying, too. Using this unique action, one of these Pokémon managed to hurl itself a record 33 feet.", pokedexNumber: 298, RoutesFound: "Route 102", Wieght: "2.0 kg", Hieght: "0.2 m"),
                               Pokemon(Name: "Nosepass", types: "Rock", DexEntry: "Nosepass’s magnetic nose is always pointed to the north. If two of these Pokémon meet, they cannot turn their faces to each other when they are close because their magnetic noses repel one another.", pokedexNumber: 299, RoutesFound: "Route 207", Wieght: "97.0 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Skitty", types: "Normal", DexEntry: "Skitty has the habit of becoming fascinated by moving objects and chasing them around. This Pokémon is known to chase after its own tail and become dizzy.", pokedexNumber: 300, RoutesFound: "Route 116", Wieght: "11.0 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Delcatty", types: "Normal", DexEntry: "Delcatty prefers to live an unfettered existence in which it can do as it pleases at its own pace. Because this Pokémon eats and sleeps whenever it decides, its daily routines are completely random.", pokedexNumber: 301, RoutesFound: "Evolve Skitty", Wieght: "32.6 kg", Hieght: "1.1 m"),
                               Pokemon(Name: "Sableye", types: "Dark/Ghost", DexEntry: "Sableye lead quiet lives deep inside caverns. They are feared, however, because these Pokémon are thought to steal the spirits of people when their eyes burn with a sinister glow in the darkness.", pokedexNumber: 302, RoutesFound: "Granite Cave", Wieght: "11.0 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Mawile", types: "Steel/Fairy", DexEntry: "Mawile’s huge jaws are actually steel horns that have been transformed. Its docile-looking face serves to lull its foe into letting down its guard. When the foe least expects it, Mawile chomps it with its gaping jaws.", pokedexNumber: 303, RoutesFound: "Granite Cave", Wieght: "11.5 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Aron", types: "Steel/Rock", DexEntry: "Aron has a body of steel. With one all-out charge, this Pokémon can demolish even a heavy dump truck. The destroyed dump truck then becomes a handy meal for the Pokémon.", pokedexNumber: 304, RoutesFound: "Granite Cave", Wieght: "60.0 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Lairon", types: "Steel/Rock", DexEntry: "Lairon tempers its steel body by drinking highly nutritious mineral springwater until it is bloated. This Pokémon makes its nest close to springs of delicious water.", pokedexNumber: 305, RoutesFound: "Evolve Aron", Wieght: "120.0 kg", Hieght: "0.9 m"),
                               Pokemon(Name: "Aggron", types: "Steel/Rock", DexEntry: "Aggron claims an entire mountain as its own territory. It mercilessly beats up anything that violates its environment. This Pokémon vigilantly patrols its territory at all times.", pokedexNumber: 306, RoutesFound: "Evolve Lairon", Wieght: "360.0 kg", Hieght: "2.1 m"),
                               Pokemon(Name: "Meditite", types: "Fighting/Psychic", DexEntry: "Meditite undertakes rigorous mental training deep in the mountains. However, whenever it meditates, this Pokémon always loses its concentration and focus. As a result, its training never ends.", pokedexNumber: 307, RoutesFound: "Route 112, Route 113", Wieght: "11.2 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Medicham", types: "Fighting/Psychic", DexEntry: "Through the power of meditation, Medicham developed its sixth sense. It gained the ability to use psychokinetic powers. This Pokémon is known to meditate for a whole month without eating.", pokedexNumber: 308, RoutesFound: "Evolve Meditite", Wieght: "31.5 kg", Hieght: "1.3 m"),
                               Pokemon(Name: "Electrike", types: "Electric", DexEntry: "Electrike stores electricity in its long body hair. This Pokémon stimulates its leg muscles with electric charges. These jolts of power give its legs explosive acceleration performance.", pokedexNumber: 309, RoutesFound: "Route 110, Route 118", Wieght: "15.2 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Manectric", types: "Electric", DexEntry: "Manectric is constantly discharging electricity from its mane. The sparks sometimes ignite forest fires. When running at full speed, it cannot stop moving.", pokedexNumber: 310, RoutesFound: "Evolve Electrike", Wieght: "40.2 kg", Hieght: "1.5 m"),
                               Pokemon(Name: "Plusle", types: "Electric", DexEntry: "Plusle always acts as a cheerleader for its partners. Whenever a teammate puts out a good effort in battle, this Pokémon shorts out its body to create the crackling noises of sparks to show its joy.", pokedexNumber: 311, RoutesFound: "Route 110 (Ruby)", Wieght: "4.2 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Minun", types: "Electric", DexEntry: "Minun is more concerned about cheering on its partners than its own safety. It shorts out the electricity in its body to create brilliant showers of sparks to cheer on its teammates.", pokedexNumber: 312, RoutesFound: "Route 110 (Sapphire)", Wieght: "4.2 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Volbeat", types: "Bug", DexEntry: "Volbeat’s tail glows like a lightbulb. With other Volbeat, it uses its tail to draw geometric shapes in the night sky. This Pokémon loves the sweet aroma given off by Illumise.", pokedexNumber: 313, RoutesFound: "Route 117, Route 118", Wieght: "17.7 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Illumise", types: "Bug", DexEntry: "Illumise attracts a swarm of Volbeat using a sweet fragrance. Once the Volbeat have gathered, this Pokémon leads them in drawing geometric shapes in the night sky.", pokedexNumber: 314, RoutesFound: "Route 117, Route 118", Wieght: "17.7 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Roselia", types: "Grass/Poison", DexEntry: "Roselia shoots sharp thorns as projectiles at any opponent that tries to steal the flowers on its arms. The aroma of this Pokémon brings serenity to living things.", pokedexNumber: 315, RoutesFound: "Route 117", Wieght: "2.0 kg", Hieght: "0.3 m"),
                               Pokemon(Name: "Gulpin", types: "Poison", DexEntry: "Gulpin can swallow anything whole with its cavernous mouth. It stores food in its stomach for digestion later. This Pokémon’s stomach is so strong, even eating moldy or rotten food will not affect it.", pokedexNumber: 316, RoutesFound: "Route 110, Route 111", Wieght: "10.3 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Swalot", types: "Poison", DexEntry: "Swalot has no teeth, so what it eats, it swallows whole, no matter what the size. Its cavernous mouth is capable of swallowing prey whole. It also stores food in its cheeks.", pokedexNumber: 317, RoutesFound: "Evolve Gulpin", Wieght: "80.0 kg", Hieght: "1.7 m"),
                               Pokemon(Name: "Carvanha", types: "Water/Dark", DexEntry: "Carvanha’s strongly developed jaws and its sharply pointed fangs pack the destructive power to rip out boat hulls. Many boats have been attacked and sunk by this Pokémon.", pokedexNumber: 318, RoutesFound: "Route 118, Route 119, Petalburg City", Wieght: "20.8 kg", Hieght: "0.8 m"),
                               Pokemon(Name: "Sharpedo", types: "Water/Dark", DexEntry: "Sharpedo can swim at speeds of up to 75 mph by jetting seawater out of its backside. This Pokémon’s drawback is its inability to swim long distances.", pokedexNumber: 319, RoutesFound: "Evolve Carvanha", Wieght: "88.8 kg", Hieght: "1.8 m"),
                               Pokemon(Name: "Wailmer", types: "Water", DexEntry: "Wailmer can store water inside its body to transform itself into a ball for bouncing around on the ground. By filling itself up with more water, this Pokémon can elevate the height of its bounces.", pokedexNumber: 320, RoutesFound: "Route 106, Route 107, Route 129, Route 130, Route 131, Route 132, Route 133, Route 134, Mossdeep City, Pacifidlog Town", Wieght: "130.0 kg", Hieght: "2.0 m"),
                               Pokemon(Name: "Wailord", types: "Water", DexEntry: "Wailord is the largest of all identified Pokémon up to now. This giant Pokémon swims languorously in the vast open sea, eating massive amounts of food at once with its enormous mouth.", pokedexNumber: 321, RoutesFound: "Evolve Wailmer", Wieght: "398.0 kg", Hieght: "14.5 m"),
                               Pokemon(Name: "Numel", types: "Fire/Ground", DexEntry: "Numel is extremely dull witted—it doesn’t notice being hit. However, it can’t stand hunger for even a second. This Pokémon’s body is a seething cauldron of boiling magma.", pokedexNumber: 322, RoutesFound: "Route 112, Route 113", Wieght: "24.0 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Camerupt", types: "Fire/Ground", DexEntry: "Camerupt has a volcano inside its body. Magma of 18,000 degrees Fahrenheit courses through its body. Occasionally, the humps on this Pokémon’s back erupt, spewing the superheated magma.", pokedexNumber: 323, RoutesFound: "Evolve Numel", Wieght: "220.0 kg", Hieght: "1.9 m"),
                               Pokemon(Name: "Torkoal", types: "Fire", DexEntry: "Torkoal digs through mountains in search of coal. If it finds some, it fills hollow spaces on its shell with the coal and burns it. If it is attacked, this Pokémon spouts thick black smoke to beat a retreat.", pokedexNumber: 324, RoutesFound: "Route 111", Wieght: "80.4 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Spoink", types: "Psychic", DexEntry: "Spoink bounces around on its tail. The shock of its bouncing makes its heart pump. As a result, this Pokémon cannot afford to stop bouncing—if it stops, its heart will stop.", pokedexNumber: 325, RoutesFound: "Route 114", Wieght: "30.6 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Grumpig", types: "Psychic", DexEntry: "Grumpig uses the black pearls on its body to amplify its psychic power waves for gaining total control over its foe. When this Pokémon uses its special power, its snorting breath grows labored.", pokedexNumber: 326, RoutesFound: "Evolve Spoink", Wieght: "71.5 kg", Hieght: "0.9 m"),
                               Pokemon(Name: "Spinda", types: "Normal", DexEntry: "Spinda are distinguished by the distinctive patterns of their spots. The shaky, tottering steps of this Pokémon give it the appearance of dancing. Due to its strange movements, most people think it’s foolish.", pokedexNumber: 327, RoutesFound: "Route 113, Route 114", Wieght: "5.0 kg", Hieght: "1.1 m"),
                               Pokemon(Name: "Trapinch", types: "Ground", DexEntry: "Trapinch’s nest is a sloped, bowl-like pit dug in sand. This Pokémon patiently waits for prey to tumble down the pit. Its giant jaws have enough strength to crush even boulders.", pokedexNumber: 328, RoutesFound: "Route 111, Route 112, Route 113", Wieght: "15.0 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Vibrava", types: "Ground/Dragon", DexEntry: "Vibrava’s wings have not yet completed the process of growing. Rather than flying long distances, they are more useful for generating ultrasonic waves by vibrating.", pokedexNumber: 329, RoutesFound: "Evolve Trapinch", Wieght: "15.3 kg", Hieght: "1.1 m"),
                               Pokemon(Name: "Flygon", types: "Ground/Dragon", DexEntry: "Flygon is nicknamed “the elemental spirit of the desert.” Because its flapping wings whip up a cloud of sand, this Pokémon is always enveloped in a sandstorm while flying.", pokedexNumber: 330, RoutesFound: "Evolve Vibrava", Wieght: "82.0 kg", Hieght: "2.0 m"),
                               Pokemon(Name: "Cacnea", types: "Grass", DexEntry: "Cacnea lives in arid locations such as deserts. It releases a strong aroma from its flower to attract prey. When prey comes near, this Pokémon shoots sharp thorns from its body to bring the victim down.", pokedexNumber: 331, RoutesFound: "Route 111, Route 112, Route 113, Route 114", Wieght: "51.3 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Cacturne", types: "Grass/Dark", DexEntry: "Cacturne lives in arid regions with minimal rainfall. This Pokémon’s appearance is similar to a human. When it senses danger, it will hide itself by immersing its body in sand.", pokedexNumber: 332, RoutesFound: "Evolve Cacnea", Wieght: "77.4 kg", Hieght: "1.3 m"),
                               Pokemon(Name: "Swablu", types: "Normal/Flying", DexEntry: "Swablu loves to make things clean. If it spots something dirty, it will wipe and polish it with its cottony wings. If its wings become dirty, this Pokémon finds a stream and showers itself.", pokedexNumber: 333, RoutesFound: "Route 114", Wieght: "1.2 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Altaria", types: "Dragon/Flying", DexEntry: "Altaria dances and wheels through the sky among billowing, cotton-like clouds. By singing melodies in its crystal-clear voice, this Pokémon makes its listeners experience dreamy wonderment.", pokedexNumber: 334, RoutesFound: "Evolve Swablu", Wieght: "20.6 kg", Hieght: "1.1 m"),
                               Pokemon(Name: "Zangoose", types: "Normal", DexEntry: "Memories of battling its archrival Seviper are etched into every cell of Zangoose’s body. This Pokémon adroitly dodges attacks with incredible agility.", pokedexNumber: 335, RoutesFound: "Route 114", Wieght: "40.3 kg", Hieght: "1.3 m"),
                               Pokemon(Name: "Seviper", types: "Poison", DexEntry: "Seviper shares a generations-long feud with Zangoose. The scars on its body are evidence of vicious battles. This Pokémon attacks using its sword-edged tail.", pokedexNumber: 336, RoutesFound: "Route 114", Wieght: "52.5 kg", Hieght: "2.7 m"),
                               Pokemon(Name: "Lunatone", types: "Rock/Psychic", DexEntry: "Lunatone was discovered at a location where a meteoroid fell. As a result, some people theorize that this Pokémon came from space. However, no one has been able to prove this theory so far.", pokedexNumber: 337, RoutesFound: "Meteor Falls", Wieght: "168.0 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Solrock", types: "Rock/Psychic", DexEntry: "Solrock is a new species of Pokémon that is said to have fallen from space. It floats in air and moves silently. In battle, this Pokémon releases intensely bright light.", pokedexNumber: 338, RoutesFound: "Meteor Falls", Wieght: "154.0 kg", Hieght: "1.2 m"),
                               Pokemon(Name: "Barboach", types: "Water/Ground", DexEntry: "Barboach’s sensitive whiskers serve as a superb radar system. This Pokémon hides in mud, leaving only its two whiskers exposed while it waits for prey to come along.", pokedexNumber: 339, RoutesFound: "Route 111, Route 114, Meteor Falls", Wieght: "1.9 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Whiscash", types: "Water/Ground", DexEntry: "Whiscash is extremely territorial. Just one of these Pokémon will claim a large pond as its exclusive territory. If a foe approaches it, it thrashes about and triggers a massive earthquake.", pokedexNumber: 340, RoutesFound: "Evolve Barboach", Wieght: "23.6 kg", Hieght: "0.9 m"),
                               Pokemon(Name: "Corphish", types: "Water", DexEntry: "Corphish were originally foreign Pokémon that were imported as pets. They eventually turned up in the wild. This Pokémon is very hardy and has greatly increased its population.", pokedexNumber: 341, RoutesFound: "Route 102", Wieght: "11.5 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Crawdaunt", types: "Water/Dark", DexEntry: "Crawdaunt has an extremely violent nature that compels it to challenge other living things to battle. Other life-forms refuse to live in ponds inhabited by this Pokémon, making them desolate places.", pokedexNumber: 342, RoutesFound: "Evolve Corphish", Wieght: "32.8 kg", Hieght: "1.1 m"),
                               Pokemon(Name: "Baltoy", types: "Ground/Psychic", DexEntry: "Baltoy moves while spinning around on its one foot. Primitive wall paintings depicting this Pokémon living among people were discovered in some ancient ruins.", pokedexNumber: 343, RoutesFound: "Route 111, Route 112", Wieght: "21.5 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Claydol", types: "Ground/Psychic", DexEntry: "Claydol are said to be dolls of mud made by primitive humans and brought to life by exposure to a mysterious ray. This Pokémon moves about while levitating.", pokedexNumber: 344, RoutesFound: "Evolve Baltoy", Wieght: "108.0 kg", Hieght: "1.5 m"),
                               Pokemon(Name: "Lileep", types: "Rock/Grass", DexEntry: "Lileep became extinct approximately a hundred million years ago. This ancient Pokémon attaches itself to a rock on the seafloor and catches approaching prey using tentacles shaped like flower petals.", pokedexNumber: 345, RoutesFound: "Route 124", Wieght: "23.8 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Cradily", types: "Rock/Grass", DexEntry: "Cradily roams around the ocean floor in search of food. This Pokémon freely extends its tree trunk-like neck and captures unwary prey using its eight tentacles.", pokedexNumber: 346, RoutesFound: "Evolve Lileep", Wieght: "60.4 kg", Hieght: "1.5 m"),
                               Pokemon(Name: "Anorith", types: "Rock/Bug", DexEntry: "Anorith was regenerated from a prehistoric fossil. This primitive Pokémon once lived in warm seas. It grips its prey firmly between its two large claws.", pokedexNumber: 347, RoutesFound: "Route 106", Wieght: "12.5 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Armaldo", types: "Rock/Bug", DexEntry: "Armaldo is a Pokémon species that became extinct in prehistoric times. This Pokémon is said to have walked on its hind legs, which would have been more convenient for life on land.", pokedexNumber: 348, RoutesFound: "Evolve Anorith", Wieght: "68.2 kg", Hieght: "1.5 m"),
                               Pokemon(Name: "Feebas", types: "Water", DexEntry: "Feebas’s fins are ragged and tattered from the start of its life. Because of its shoddy appearance, this Pokémon is largely ignored. It is capable of living in both the sea and in rivers.", pokedexNumber: 349, RoutesFound: "Route 119 (fishing with Old Rod), Route 120 (fishing with Good Rod)", Wieght: "7.4 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Milotic", types: "Water", DexEntry: "Milotic is said to be the most beautiful of all the Pokémon. It has the power to becalm such emotions as anger and hostility to quell bitter feuding.", pokedexNumber: 350, RoutesFound: "Evolve Feebas", Wieght: "162.0 kg", Hieght: "6.2 m"),
                               Pokemon(Name: "Castform", types: "Normal", DexEntry: "Castform borrows the power of nature to transform itself into the guises of the sun, rain clouds, and snow clouds. This Pokémon’s feelings change with the weather.", pokedexNumber: 351, RoutesFound: "Route 119 (weather-dependent)", Wieght: "0.8 kg", Hieght: "0.3 m"),
                               Pokemon(Name: "Kecleon", types: "Normal", DexEntry: "Kecleon is capable of changing its body colors at will to blend in with its surroundings. There is one exception—this Pokémon can’t change the zigzag pattern on its belly.", pokedexNumber: 352, RoutesFound: "Route 120, Route 121, Route 122, Route 123, Route 124, Route 125, Route 126, Route 127, Route 128, Route 129, Route 130, Route 131, Route 132, Route 133, Route 134", Wieght: "22.0 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Shuppet", types: "Ghost", DexEntry: "Shuppet is attracted by feelings of jealousy and vindictiveness. If someone develops strong feelings of vengeance, this Pokémon will appear in a swarm and line up beneath the eaves of that person’s home.", pokedexNumber: 353, RoutesFound: "Mt. Pyre", Wieght: "2.3 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Banette", types: "Ghost", DexEntry: "A cursed energy permeated the stuffing of a discarded and forgotten plush doll, giving it new life as Banette. The Pokémon’s energy would escape if it were to ever open its mouth.", pokedexNumber: 354, RoutesFound: "Evolve Shuppet", Wieght: "12.5 kg", Hieght: "1.1 m"),
                               Pokemon(Name: "Duskull", types: "Ghost", DexEntry: "Duskull can pass through any wall no matter how thick it may be. Once this Pokémon chooses a target, it will doggedly pursue the intended victim until the break of dawn.", pokedexNumber: 355, RoutesFound: "Route 121", Wieght: "15.0 kg", Hieght: "0.8 m"),
                               Pokemon(Name: "Dusclops", types: "Ghost", DexEntry: "Dusclops’s body is completely hollow—there is nothing at all inside. It is said that its body is like a black hole. This Pokémon will absorb anything into its body, but nothing will ever come back out.", pokedexNumber: 356, RoutesFound: "Evolve Duskull", Wieght: "30.6 kg", Hieght: "1.6 m"),
                               Pokemon(Name: "Tropius", types: "Grass/Flying", DexEntry: "Tropius flies by flapping the leaves on its back as if they were wings. This Pokémon flies around the jungle, scattering its seeds and spreading plant life in all directions.", pokedexNumber: 357, RoutesFound: "Route 119", Wieght: "100.0 kg", Hieght: "2.0 m"),
                               Pokemon(Name: "Chimecho", types: "Psychic", DexEntry: "Chimecho makes its cries echo inside its hollow body. When this Pokémon becomes enraged, its cries result in ultrasonic waves that have the power to knock foes flying.", pokedexNumber: 358, RoutesFound: "Route 124 (PokéNav needed)", Wieght: "1.0 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Absol", types: "Dark", DexEntry: "Every time Absol appears before people, it is followed by a disaster such as an earthquake or a tidal wave. As a result, it came to be known as the disaster Pokémon.", pokedexNumber: 359, RoutesFound: "Route 120, Route 121", Wieght: "47.0 kg", Hieght: "1.2 m"),
                               Pokemon(Name: "Wynaut", types: "Psychic", DexEntry: "Wynaut can always be seen with a big, happy smile on its face. Look at its tail to determine if it is angry. When angered, this Pokémon will be slapping the ground with its tail.", pokedexNumber: 360, RoutesFound: "Mirage Cave (Route 109)", Wieght: "14.0 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Snorunt", types: "Ice", DexEntry: "Snorunt survives by eating only snow and ice. Old folklore claims that a house visited by this Pokémon is sure to prosper for many generations to come.", pokedexNumber: 361, RoutesFound: "Route 124 (Shoal Cave)", Wieght: "16.8 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Glalie", types: "Ice", DexEntry: "Glalie has the ability to freely control ice. For example, it can instantly freeze its foe solid. After immobilizing its foe in ice, this Pokémon enjoys eating it in leisurely fashion.", pokedexNumber: 362, RoutesFound: "Evolve Snorunt", Wieght: "256.5 kg", Hieght: "1.5 m"),
                               Pokemon(Name: "Spheal", types: "Ice/Water", DexEntry: "Spheal is much faster rolling than walking to get around. When groups of this Pokémon eat, they all clap at once to show their pleasure. Because of this, their mealtimes are noisy.", pokedexNumber: 363, RoutesFound: "Route 124", Wieght: "39.5 kg", Hieght: "0.8 m"),
                               Pokemon(Name: "Sealeo", types: "Ice/Water", DexEntry: "Sealeo often balances and rolls things on the tip of its nose. While the Pokémon is rolling something, it checks the object’s aroma and texture to determine whether it likes the object or not.", pokedexNumber: 364, RoutesFound: "Evolve Spheal", Wieght: "87.6 kg", Hieght: "1.1 m"),
                               Pokemon(Name: "Walrein", types: "Ice/Water", DexEntry: "Walrein’s two massively developed tusks can totally shatter blocks of ice weighing ten tons with one blow. This Pokémon’s thick coat of blubber insulates it from subzero temperatures.", pokedexNumber: 365, RoutesFound: "Evolve Sealeo", Wieght: "150.6 kg", Hieght: "1.4 m"),
                               Pokemon(Name: "Clamperl", types: "Water", DexEntry: "Clamperl’s sturdy shell is not only good for protection—it is also used for clamping and catching prey. A fully grown Clamperl’s shell will be scored with nicks and scratches all over.", pokedexNumber: 366, RoutesFound: "Route 124 (diving)", Wieght: "52.5 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Huntail", types: "Water", DexEntry: "Huntail’s presence went unnoticed by people for a long time because it lives at extreme depths in the sea. This Pokémon’s eyes can see clearly even in the murky dark depths of the ocean.", pokedexNumber: 367, RoutesFound: "Evolve Clamperl (Trade with DeepSeaTooth)", Wieght: "27.0 kg", Hieght: "1.7 m"),
                               Pokemon(Name: "Gorebyss", types: "Water", DexEntry: "Although Gorebyss is the very picture of elegance and beauty while swimming, it is also cruel. When it spots prey, this Pokémon inserts its thin mouth into the prey’s body and drains the prey of its body fluids.", pokedexNumber: 368, RoutesFound: "Evolve Clamperl (Trade with DeepSeaScale)", Wieght: "22.6 kg", Hieght: "1.8 m"),
                               Pokemon(Name: "Relicanth", types: "Water/Rock", DexEntry: "Relicanth is a Pokémon species that existed for a hundred million years without ever changing its form. This ancient Pokémon feeds on microscopic organisms with its toothless mouth.", pokedexNumber: 369, RoutesFound: "Underwater (Route 124, 126, 127, 128, 129, 130, 131, 132, 133, 134, Ever Grande City)", Wieght: "23.4 kg", Hieght: "1.0 m"),
                               Pokemon(Name: "Luvdisc", types: "Water", DexEntry: "Luvdisc make the branches of Corsola their nests. There is a custom from long ago of giving a Luvdisc as a gift to express one’s feelings of love.", pokedexNumber: 370, RoutesFound: "Route 128, Ever Grande City (fishing with Super Rod)", Wieght: "8.7 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Bagon", types: "Dragon", DexEntry: "Bagon has a dream of one day soaring in the sky. In doomed efforts to fly, this Pokémon hurls itself off cliffs. As a result of its dives, its head has grown tough and as hard as tempered steel.", pokedexNumber: 371, RoutesFound: "Meteor Falls", Wieght: "42.1 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Shelgon", types: "Dragon", DexEntry: "Shelgon conceals itself beneath rocks and remains completely still, preparing for evolution. Its shell is very hard, but it is still light enough for Shelgon to fly freely.", pokedexNumber: 372, RoutesFound: "Evolve Bagon", Wieght: "110.5 kg", Hieght: "1.1 m"),
                               Pokemon(Name: "Salamence", types: "Dragon/Flying", DexEntry: "Salamence came about as a result of a strong, long-held dream of growing wings. It is said that this powerful desire triggered a sudden mutation in this Pokémon’s cells, causing it to sprout its magnificent wings.", pokedexNumber: 373, RoutesFound: "Evolve Shelgon", Wieght: "102.6 kg", Hieght: "1.5 m"),
                               Pokemon(Name: "Beldum", types: "Steel/Psychic", DexEntry: "Beldum keeps itself floating by generating a magnetic force that repels earth’s natural magnetism. This Pokémon communicates with others by sending controlled pulses of magnetism.", pokedexNumber: 374, RoutesFound: "Steven's house (Mossdeep City) after obtaining the HM08 Dive", Wieght: "95.2 kg", Hieght: "0.6 m"),
                               Pokemon(Name: "Metang", types: "Steel/Psychic", DexEntry: "Metang is the result of two Beldum connecting. When hunting, this Pokémon pins the prey to the ground under its massive body. It then eats the helpless victim using the large mouth on its stomach.", pokedexNumber: 375, RoutesFound: "Evolve Beldum", Wieght: "202.5 kg", Hieght: "1.2 m"),
                               Pokemon(Name: "Metagross", types: "Steel/Psychic", DexEntry: "Metagross has four brains in total. Combined, the four brains can breeze through difficult calculations faster than a supercomputer. This Pokémon can float in the air by tucking in its four legs.", pokedexNumber: 376, RoutesFound: "Evolve Metang", Wieght: "550.0 kg", Hieght: "1.6 m"),
                               Pokemon(Name: "Regirock", types: "Rock", DexEntry: "Regirock was sealed away by people long ago. If this Pokémon’s body is damaged in battle, it is said to seek out suitable rocks on its own to repair itself.", pokedexNumber: 377, RoutesFound: "Desert Ruins (Route 111)", Wieght: "230.0 kg", Hieght: "1.7 m"),
                               Pokemon(Name: "Regice", types: "Ice", DexEntry: "Regice’s body was made during an ice age. The deep-frozen body can’t be melted, even by fire. This Pokémon controls frigid air of -328 degrees Fahrenheit.", pokedexNumber: 378, RoutesFound: "Island Cave (Route 105)", Wieght: "175.0 kg", Hieght: "1.8 m"),
                               Pokemon(Name: "Registeel", types: "Steel", DexEntry: "Registeel has a body that is harder than any kind of metal. Its body is apparently hollow. No one has any idea what this Pokémon eats.", pokedexNumber: 379, RoutesFound: "Ancient Tomb (Route 120)", Wieght: "205.0 kg", Hieght: "1.9 m"),
                               Pokemon(Name: "Latias", types: "Dragon/Psychic", DexEntry: "Latias is highly sensitive to the emotions of people. If it senses any hostility, this Pokémon ruffles the feathers all over its body and cries shrilly to intimidate the foe.", pokedexNumber: 380, RoutesFound: "Southern Island", Wieght: "40.0 kg", Hieght: "1.4 m"),
                               Pokemon(Name: "Latios", types: "Dragon/Psychic", DexEntry: "Latios has the ability to make others see an image of what it has seen or imagines in its head. This Pokémon is intelligent and understands human speech.", pokedexNumber: 381, RoutesFound: "Southern Island", Wieght: "60.0 kg", Hieght: "2.0 m"),
                               Pokemon(Name: "Kyogre", types: "Water", DexEntry: "Kyogre has the power to create massive rain clouds that cover the entire sky and bring about torrential downpours. This Pokémon saved people who were suffering from droughts.", pokedexNumber: 382, RoutesFound: "Cave of Origin (Sootopolis City)", Wieght: "352.0 kg", Hieght: "4.5 m"),
                               Pokemon(Name: "Groudon", types: "Ground", DexEntry: "Groudon has the power to scatter rain clouds and make water evaporate with light and heat. It came as a savior to people who had been suffering from terrible floods.", pokedexNumber: 383, RoutesFound: "Cave of Origin (Sootopolis City)", Wieght: "950.0 kg", Hieght: "3.5 m"),
                               Pokemon(Name: "Rayquaza", types: "Dragon/Flying", DexEntry: "Rayquaza lived for hundreds of millions of years in the earth’s ozone layer, never descending to the ground. This Pokémon appears to feed on water and particles in the atmosphere.", pokedexNumber: 384, RoutesFound: "Sky Pillar (Route 131)", Wieght: "206.5 kg", Hieght: "7.0 m"),
                               Pokemon(Name: "Jirachi", types: "Steel/Psychic", DexEntry: "Jirachi is said to make wishes come true. While it sleeps, a tough crystalline shell envelops the body to protect it from enemies.", pokedexNumber: 385, RoutesFound: "Unlockable event in Pokémon Ruby, Sapphire, and Emerald", Wieght: "1.1 kg", Hieght: "0.3 m"),
                               Pokemon(Name: "Deoxys", types: "Psychic", DexEntry: "The DNA of a space virus underwent a sudden mutation upon exposure to a laser beam and resulted in Deoxys. The crystalline organ on this Pokémon’s chest appears to be its brain.", pokedexNumber: 386, RoutesFound: "Unlockable event in Pokémon Ruby, Sapphire, and Emerald Or At The Sky Pillar In Omega Ruby / Alpha Saphire Delta Episode", Wieght: "60.8 kg", Hieght: "1.7 m"),
                               Pokemon(Name: "Turtwig", types: "Grass", DexEntry: "It undertakes photosynthesis with its body, making oxygen. The leaf on its head wilts if it is thirsty.", pokedexNumber: 387, RoutesFound: "Starter Pokémon (Sinnoh)", Wieght: "10.2 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Grotle", types: "Grass", DexEntry: "It lives along water in forests. In the daytime, it leaves the forest to sunbathe its treed shell.", pokedexNumber: 388, RoutesFound: "Evolve Turtwig", Wieght: "97.0 kg", Hieght: "1.1 m"),
                               Pokemon(Name: "Torterra", types: "Grass/Ground", DexEntry: "Groups of this Pokémon migrating in search of water have been mistaken for ‘moving forests’.", pokedexNumber: 389, RoutesFound: "Evolve Grotle", Wieght: "310.0 kg", Hieght: "2.2 m"),
                               Pokemon(Name: "Chimchar", types: "Fire", DexEntry: "It agilely scales sheer cliffs to live atop craggy mountains. Its fire is put out when it sleeps.", pokedexNumber: 390, RoutesFound: "Starter Pokémon (Sinnoh)", Wieght: "6.2 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Monferno", types: "Fire/Fighting", DexEntry: "To intimidate attackers, it stretches the fire on its tail to make itself appear bigger.", pokedexNumber: 391, RoutesFound: "Evolve Chimchar", Wieght: "22.0 kg", Hieght: "0.9 m"),
                               Pokemon(Name: "Infernape", types: "Fire/Fighting", DexEntry: "It tosses its enemies around with agility. It uses all its limbs to fight in its own unique style.", pokedexNumber: 392, RoutesFound: "Evolve Monferno", Wieght: "55.0 kg", Hieght: "1.2 m"),
                               Pokemon(Name: "Piplup", types: "Water", DexEntry: "Because it is very proud, it hates accepting food from people. Its thick down guards it from cold.", pokedexNumber: 393, RoutesFound: "Starter Pokémon (Sinnoh)", Wieght: "5.2 kg", Hieght: "0.4 m"),
                               Pokemon(Name: "Prinplup", types: "Water", DexEntry: "It lives alone, away from others. Apparently, every one of them believes it is the most important.", pokedexNumber: 394, RoutesFound: "Evolve Piplup", Wieght: "23.0 kg", Hieght: "0.8 m"),
                               Pokemon(Name: "Empoleon", types: "Water/Steel", DexEntry: "If anyone were to hurt its pride, it would slash them with wings that can cleave through an ice floe.", pokedexNumber: 395, RoutesFound: "Evolve Prinplup", Wieght: "84.5 kg", Hieght: "1.7 m"),
                               Pokemon(Name: "Starly", types: "Normal/Flying", DexEntry: "They flock around mountains and fields, chasing after bug Pokémon. Their singing is noisy and annoying.", pokedexNumber: 396, RoutesFound: "Route 201, Route 202, Route 203, Route 204, Route 209, Route 212, Route 215", Wieght: "2.0 kg", Hieght: "0.3 m"),
                               Pokemon(Name: "Staravia", types: "Normal/Flying", DexEntry: "It flies around forests and fields in search of bug Pokémon. It stays within a huge flock.", pokedexNumber: 397, RoutesFound: "Evolve Starly", Wieght: "15.5 kg", Hieght: "0.7 m"),
                               Pokemon(Name: "Staraptor", types: "Normal/Flying", DexEntry: "It has a savage nature. It will courageously challenge foes that are much larger.", pokedexNumber: 398, RoutesFound: "Evolve Staravia", Wieght: "24.9 kg", Hieght: "1.2 m"),
                               Pokemon(Name: "Bidoof", types: "Normal", DexEntry: "With nerves of steel, nothing can perturb it. It is more agile and active than it appears.", pokedexNumber: 399, RoutesFound: "Route 201, Route 202, Route 203, Route 204, Route 205, Route 208, Route 209, Route 210, Route 211, Route 214, Route 215, Route 218, Route 219", Wieght: "20.0 kg", Hieght: "0.5 m"),
                               Pokemon(Name: "Bibarel", types: "Normal/Water", DexEntry: "It makes its nest by damming streams with bark and mud. It is known as an industrious worker.", pokedexNumber: 400, RoutesFound: "Evolve Bidoof", Wieght: "31.5 kg", Hieght: "1.0 m"),
